import React, { Component } from 'react';
import HomePage from './pages/HomePage';
import { Switch, Route } from 'react-router-dom';

class App extends Component {
    state = {}
    render() {
        return (
            <div>
                <Switch>
                    <Route exact path='/' component={HomePage} />
                </Switch>
            </div>
        );
    }
}

export default App;
